(5821, 430, 'steam:1100001076035fc', 'The silence...it\'s peaceful. Enjoy your peace, Los Santos. The time edges ever closer. Those who know me can attest to my word, so trust me in this: No harm will come to the funeral. The innocent don\'t deserve further pain that what is there.', '2020-01-17 19:48:23', 0),
(5822, 430, 'steam:1100001076035fc', 'I have a message to send to the people. Your leaders are compromised and not trustworthy. I hope the events of tonight will show this to you all, and you will see that I mean no harm to the average citizen of Los Santos. But some of you need a wake up.', '2020-01-17 19:50:49', 0),
(5823, 430, 'steam:1100001076035fc', 'To the police of Los Santos: I have worked closely with you for some time now. I respect a great deal of you. But you have corruption within that I cannot tolerate, and I hope that you will come to find that in your investigations.', '2020-01-17 19:52:02', 0),
(5824, 430, 'steam:1100001076035fc', 'To those who are/were among my friends: I love you all. Know that I do this not to cause fear, but to make a point. If you are innocent, you are safe. Those who are guilty of corruption and compromise, your sins will be exposed. The Fox is tired of lies.', '2020-01-17 19:53:26', 0),
(5825, 430, 'steam:1100001076035fc', 'I love this city. I love each of you that showed me compassion and understanding. Hell, I even like some of you who are less than innocent. But one thing I have never suffered is lying to the innocent for personal gain.', '2020-01-17 19:55:25', 0),
(5826, 430, 'steam:1100001076035fc', 'Even if it costs me my freedom in the end, or even my own life, I will expose the dirtiest among you. I will show you the compromise in your own justice system. And I will free you from the shackles of tyranny that those in power have placed upon you.', '2020-01-17 19:56:24', 0),
(5827, 430, 'steam:1100001076035fc', 'None of you who harm the innocent or perpetuate corruption will survive the coming days. I was a better ally than enemy to the city. And now that I know what I know and am not shackled by being a lawyer....I will share this information with you.', '2020-01-17 19:58:17', 0),
(5828, 430, 'steam:1100001076035fc', 'I may be an enemy of the state, but so were many revolutionaries. Even this country\'s own founding fathers. I give you all my word, right here and right now, this will not end until the corruption stops. The Fox will protect this city. Even from itself.', '2020-01-17 19:59:59', 0),
(5829, 430, 'steam:1100001076035fc', 'So, condolences to those who knew Alex, and I pray with all I have his funeral is a peaceful one. For now, enjoy this peaceful quiet, as only the gods know when it will end.', '2020-01-17 20:01:37', 0),
