INSERT INTO `twitter_tweets` (`id`, `authorId`, `realUser`, `message`, `time`, `likes`) VALUES
(7400, 308, 'steam:11000010e13fde7', 'anyone need a pick up', '2020-01-27 23:27:58', 0),
(7401, 914, 'steam:11000011ac5e3b5', 'its tiffany add me on discord joe king#6205', '2020-01-27 23:29:27', 0),
(7402, 880, 'steam:11000010d932765', 'Fennys discordia is ShuggahFox#6146', '2020-01-27 23:29:44', 0),
(7403, 867, 'steam:1100001076035fc', 'It\'s over. I don\'t have to hide anymore. I\'m coming back, Los Santos. And I mean no harm to anyone. Please, give me a chance to prove it to you all.', '2020-01-28 00:15:14', 0),
(7404, 834, 'steam:11000010b15d112', 'where yall at', '2020-01-28 00:15:55', 0),
(7405, 867, 'steam:1100001076035fc', '@Pistone....I want to bury the hatchet.', '2020-01-28 00:18:05', 0),
(7406, 782, 'steam:110000102e90377', 'I am on duty at Racer\'s Edge', '2020-01-28 00:24:01', 0),
(7407, 867, 'steam:1100001076035fc', 'I can\'t wait to sing for you all again...I\'ve missed it....', '2020-01-28 00:24:49', 0),
(7408, 782, 'steam:110000102e90377', 'Levi??!  Are you gone for good?  :( :(', '2020-01-28 00:26:07', 0),
