(7410, 463, 'steam:110000100628d54', 'Is Racers Edge still closed?', '2020-01-28 00:49:12', 0),
(7411, 782, 'steam:110000102e90377', '@Rain I\'ll be back to it in a few', '2020-01-28 00:49:56', 0),
(7412, 463, 'steam:110000100628d54', '@MountainMan Okay just text me when you\'re available 798-3940', '2020-01-28 00:50:17', 0),
(7413, 782, 'steam:110000102e90377', 'Racer\'s Edge is open and staffed', '2020-01-28 00:51:54', 0),
(7414, 867, 'steam:1100001076035fc', 'Since the game is now over, let me clue you in on one last detail. I was hiding amongst you all as Daniel MacDavish, head reporter of Weazel News. I run the account, and have been providing you all with info this whole time.', '2020-01-28 00:53:54', 1),
(7415, 912, 'steam:11000010d932765', 'Got no number anymore..Im looking for you though..were you at Sir Snow?', '2020-01-28 01:00:50', 0),
(7416, 856, 'steam:11000010ba7c549', 'Hey everyone', '2020-01-28 01:17:07', 0),
(7417, 834, 'steam:11000010b15d112', '@ItsPaulEnnis hola', '2020-01-28 01:17:43', 0),
(7418, 782, 'steam:110000102e90377', 'This Epeidemic has taken so many dear friends...', '2020-01-28 01:21:16', 0),
