(7420, 856, 'steam:11000010ba7c549', 'We\'ll move on. we can rebuild.', '2020-01-28 01:21:46', 0),
(7421, 782, 'steam:110000102e90377', 'I fear I may be catching the disease... Time will tell if I pull through', '2020-01-28 01:21:50', 0),
(7422, 856, 'steam:11000010ba7c549', 'Also EMS is on duty if you need any medical attention', '2020-01-28 01:22:18', 0),
(7423, 923, 'steam:1100001324f89dc', 'Lou still here baby, mechanic shop will one day be poppin\' again! I will miss my late colleagues.', '2020-01-28 01:22:24', 1),
